import { useLocation } from "react-router-dom";

const Resultaat = () => {
  if (typeof distance !== "number" || isNaN(distance)) {
    console.error("Ongeldige afstand ontvangen:", distance);
    distance = 0; // Standaardwaarde om crash te voorkomen
}

  const location = useLocation();
  const { distance, selectedCoordinates, streetViewStartCoordinates } = location.state || {};

  return (
    <div className="result-container">
      <h1>Resultaat</h1>
      {distance !== undefined ? (
        <>
          <p>Afstand tussen geselecteerde locatie en werkelijke locatie:</p>
          <h2>{distance.toFixed(2)} km</h2>
          <div className="coordinates">
            <p><strong>Jouw keuze:</strong> Lat: {selectedCoordinates.lat}, Lng: {selectedCoordinates.lng}</p>
            <p><strong>Werkelijke locatie:</strong> Lat: {streetViewStartCoordinates.lat}, Lng: {streetViewStartCoordinates.lng}</p>
          </div>
        </>
      ) : (
        <p>Geen data ontvangen. Ga terug en probeer opnieuw.</p>
      )}
    </div>
  );
};

export default Resultaat;
